const aiInput = $input.first().json;

// Extract original form data (passed through from previous nodes)
const formData = {
  review_text: $('üß™ Code').first().json.review_text,
  customer_name: $('üß™ Code').first().json.customer_name,
  rating: $('üß™ Code').first().json.rating,
  product_service: $('üß™ Code').first().json.product_service,
  review_date: new Date().toISOString()
};

// Parse AI response - it should be a JSON string
let aiResponse = {};
try {
  if (typeof aiInput.response === 'string') {
    aiResponse = JSON.parse(aiInput.response);
  } else if (aiInput.response && typeof aiInput.response === 'object') {
    aiResponse = aiInput.response;
  } else {
    aiResponse = aiInput;
  }
} catch (error) {
  console.error('Failed to parse AI response:', error);
  aiResponse = {
    sentiment: 'neutral',
    sentiment_score: 0.5,
    category: 'unspecified',
    priority: 'medium',
    department: 'customer_support',
    action_required: true,
    key_insights: ['Failed to analyze review'],
    suggested_response_tone: 'informative',
    keywords: [],
    summary: 'Analysis failed'
  };
}

// Safety fallback
const sentiment = aiResponse.sentiment ?? 'neutral';

// Construct final processed output (data only)
const processedData = {
  // Original data
  review_text: formData.review_text,
  customer_name: formData.customer_name,
  rating: formData.rating,
  product_service: formData.product_service,
  review_date: formData.review_date,

  // Enriched data
  sentiment,
  sentiment_score: aiResponse.sentiment_score ?? 0.5,
  category: aiResponse.category ?? 'unspecified',
  priority: aiResponse.priority ?? 'medium',
  department: aiResponse.department ?? 'customer_support',
  action_required: aiResponse.action_required ?? true,
  key_insights: aiResponse.key_insights ?? [],
  suggested_response_tone: aiResponse.suggested_response_tone ?? 'informative',
  keywords: aiResponse.keywords ?? [],
  summary: aiResponse.summary ?? '',

  // Computed metadata
  task_title: `Review Response: ${sentiment.toUpperCase()} - ${formData.customer_name}`,
  task_description: `Customer Review Analysis

Customer: ${formData.customer_name}
Rating: ${formData.rating}/5
Sentiment: ${sentiment} (${aiResponse.sentiment_score ?? 'N/A'})
Category: ${aiResponse.category ?? 'unspecified'}
Priority: ${aiResponse.priority ?? 'medium'}

Review: "${formData.review_text}"

Key Insights:
${(aiResponse.key_insights ?? []).map(i => `‚Ä¢ ${i}`).join('\n')}

Suggested Response Tone: ${aiResponse.suggested_response_tone ?? 'informative'}

Keywords: ${(aiResponse.keywords ?? []).join(', ')}`,

  // Due date logic
  due_date:
    (aiResponse.priority ?? 'medium') === 'high'
      ? new Date(Date.now() + 1 * 24 * 60 * 60 * 1000).toISOString()
      : (aiResponse.priority ?? 'medium') === 'medium'
      ? new Date(Date.now() + 3 * 24 * 60 * 60 * 1000).toISOString()
      : new Date(Date.now() + 7 * 24 * 60 * 60 * 1000).toISOString()
};

return processedData;
